import Particle from './Particle.js';
import imgg from '../imgg.jpg';
import '../../App.css';

export default function About() {

  return (
      <div className="img grid lg:grid-cols-2 m-10 gap-10">
       <img src={imgg} alt="img"/>
       <div>

       <img src={imgg} alt="img"/>
       </div>
       <Particle />
    </div>
  );
}
